properties.value:
{

    title: {
        text: 'Internet Explorer Market Share',
    },
    subtitle: {
        text: '2009-2019 (aka "good times")',
    },
    data: getData(),
    series: [
        {
            type: 'area',
            xKey: 'year',
            yKeys: ['ie'],
            yNames: ['IE'],
            marker: {
                enabled: true,
            },
            label: {
                enabled: true,
                fontWeight: 'bold',
            },
            tooltip: {
                renderer: function (params) {
                    return {
                        content: params.yName + ' - ' + params.yValue + '% - Jan ' + params.xValue,
                    };
                },
            },
        },
    ],
    legend: {
        enabled: false,
    },
}
